import React, { Component } from 'react';
import { View, StyleSheet, Animated, Image, TextInput } from 'react-native';

export default function Category() {
    return (
        <View style={styles.container}>
          <View style={styles.category_active}>
            All    
          </View>
          <View style={styles.category_normal}>
            Finance    
          </View>
          <View style={styles.category_normal}>
            Music    
          </View>
          <View style={styles.category_normal}>
            Travel    
          </View>
        </View>
    )
}

// styles
const styles = StyleSheet.create({
  container: {
    marginBottom: 20,  
    justifyContent: "flex-start",
    alignItems: "center",
    flexDirection: "row",
    borderRadius: 12,
  },
  category_active: {
    backgroundColor: '#FFFFFF',
    fontColor: '#000000',
    fontWeight: 600,
    borderRadius: 14,
    paddingLeft: 17,
    paddingRight: 17,
    paddingTop: 5,
    paddingBottom: 5,
    marginRight: 6,
  },
  category_normal: {
    backgroundColor: 'rgba(255,255,255,0.1)',
    fontColor: '#FFFFFF',
    borderRadius: 14,
    paddingLeft: 17,
    paddingRight: 17,
    paddingTop: 5,
    paddingBottom: 5,
    marginRight: 6,
  }

});
